  <div class="mt-4 flex flex-col gap-4 text-primary-black text-[16px]">
            <p>
              ApaCare - system do pielgnacji zbw pynnym szkliwem
              zapewniajcy naturalnie gadkie, zdrowe i lnice zby
              Remineralizacja pynnym szkliwem zapewniajca ochron Twoich
              zbw.
            </p>
            <p>
              Podstawowym celem nowoczesnej stomatologii jest utrzymanie jak
              najwikszej iloci zdrowych zbw tak dugo, jak to jest tylko
              moliwe. Dla wikszoci spoeczestwa symbolem pikna i zdrowych
              zbw s biae, lnice zby. Biel zbom zapewnia szkliwo. Jest
              ono atakowane kadego dnia przez bakterie, kwane poywienie i
              pyny. Rwnie pyny, bdce depozytem barwnikw (np. herbata czy
              kawa) wpywaj negatywnie na estetyk zbw. Zarwno szkliwo jak i
              zbina s wobec tych czynnikw bezbronne. Szkliwo zbowe u
              dorosych jest wysoce zmineralizowan bezkomrkow tkank,
              zawierajc 99% substancji mineralnych. Dlatego szkliwo samo w
              sobie nie ma zdolnoci regeneracji, czyli odbudowy. Wikszo
              dotychczas stosowanych materiaw uywanych do ochrony szkliwa
              (np. fluorki) dziaaj gwnie przez ograniczanie procesu
              rozpuszczania apatytu (gwnego budulca szkliwa), a nie przez
              mineralizacj prowadzc do krystalizacji apatytu lub odnowy
              utraconych zwizkw mineralnych. Zbina natomiast moe by
              odbudowana samoczynnie, ale nowa tkanka narasta jedynie w kierunku
              miazgi. Powstae uszkodzenia mona naprawi jedynie po
              zastosowaniu materiaw alloplastycznych lub materiaw naturalnie
              wystpujcych w linie. Jedn z substancji, ktra odbudowuje w
              warunkach fizjologicznych szkliwo jest zmikronizowany
              hydroksyapatyt, zwany pynnym szkliwem. Wszystkie produkty
              ApaCare zawiera medyczny hydroksyapatyt, ktry tworzy ochronn
              warstw na szkliwie, z ktrej dziki zmikronizowanej strukturze
              hydroksyapatytu wbudowuje si on w szkliwo zba. Dziki temu
              szkliwo i zby staj si bardziej gadkie i janiejsze odzyskujc
              naturalny kolor. Proces ten nazywany jest remineralizacj szkliwa.
              Medyczny hydroksyapatyt jest nietoksyczny, nie powoduje odpowiedzi
              zapalnej czy immunologicznej, co wynika z faktu, e w
              przeciwiestwie do fluoru, jest niczym nowym dla zbw, gdy
              dziaa jako biomimetyczny zamiennik utraconych czstek szkiwa.
            </p>

            <p>
              Dodatkowo, medyczny hydroksypaptyt moe by stosowane w celu
              szybkiego i trwaego zamykania otwartych kanalikw (porw)
              nadwraliwych szyjek zbowych. Medyczny hydroksyapatyt zmniejsza
              nadwraliwo zbw (np. na zimne i ciepe posiki).
            </p>

            <h5 class="font-semibold">Produkty systemu ApaCare</h5>
            <div>
              <ul class="list-disc ml-[32px]">
                <li>
                  Tworz warstwy ochronnej: pynne szkliwo tworzy niewidzialn
                  warstw ochronn, ktra pokrywa zby niczym druga skra.
                </li>
                <li>
                  Zwikszaj gadko i blask zb: pynne szkliwo zapewnia
                  lnice gadkie powierzchnie zbw, ktre nie tylko s
                  przyjemnie gadkie w dotyku, ale take zapewniaj promiennie
                  zdrowy umiech.
                </li>
                <li>
                  Naprawiaj: mae ubytki, wczesne zmiany prchnicowe, pknicia
                  i szorstkie miejsca s skutecznie naprawiane przez pynny
                  hydroksyapatyt.
                </li>
                <li>
                  Wybielaj: efekty odbicia optycznego zapewniaj naturalne
                  wybielenie zbw.
                </li>
                <li>
                  Dziaaj ochronnie na nadwraliwe szyjki zbw: pynne szkliwo
                  chroni wraliwe szyjki zbw i zauwaalnie zmniejsza reakcje
                  na gorce, zimne lub sodkie pokarmy.
                </li>
              </ul>
            </div>
            <p class="font-semibold">
              dziki zawartoci pynnego szkliwa, czyli medycznego
              hydroksyapatytu!
            </p>
            <p>
              Produkty systemu ApaCare s dostpne w dobrych aptekach,
              specjalistycznych sklepach stomatologicznych, w niektrych
              gabinetach stomatologicznych oraz w Firmie KodeNt.
            </p>
          </div>
